import React from 'react';

export default function IndexSectionCta1() {
    return (
        <React.Fragment>
            <>
                <section className="section py-24 has-background-dark">
  <div className="container">
    <div className="has-mw-xl-desktop has-mw-3xl-widescreen mx-auto has-text-centered">
      <span className="is-block mb-4 has-text-light has-text-weight-medium">Lorem Ipsum</span>
      <h1 className="title is-size-3-mobile is-size-1-tablet has-text-white mb-8" style={{letterSpacing: '-0.04em'}}>Gas Packs</h1>
      <div className="has-mw-xl mx-auto mb-10">
        <p className="is-size-7 has-text-grey-light">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.</p>
      </div>
    </div>
  </div>
</section>


            </>
        </React.Fragment>
    );
}
